from user_agents import parse
from pyspark.sql.functions import udf
from pyspark.sql.types import BooleanType

# Definir función tipo_dispositivo
def categorize_device(user_agent):
    try:
        ua = parse(user_agent)
        if ua.is_mobile:
            return 'Movil'
        elif ua.is_tablet:
            return 'Tablet'
        elif ua.is_pc:
            return 'PC'
        elif ua.is_bot:
            return 'Bot'
        elif ua.is_touch_capable:
            return 'Dispositivo con pantalla tactil'
        else:
            return 'Otros'
    except:
        return 'Error al parsear el user agent'


def parse_user_agent(user_agent):
    try:
        ua = parse(user_agent)
        return ua.os.family
    except:
        return None

# Definir función de parsing
def parse_user_agent2(user_agent):
    try:
        ua = parse(user_agent)
        return ua.os.version_string
    except:
        return None

# Registrar función de parsing como UDF
parse_user_agent_udf = udf(parse_user_agent)
parse_user_agent_udf2 = udf(parse_user_agent2)
categorize_device_udf = udf(categorize_device)

# Crear DataFrame a partir de la tabla
df3 = spark.sql("SELECT user_agent from trafico.huawei_dpi_consolidado where fecha between 20230501 and 20230531 group by user_agent")

# # Agregar columna 'version_parser_OS' y 'version_parser_num' que contiene la versión del sistema operativo extraída del user_agent
df3 = df3.withColumn('version_parser_OS', parse_user_agent_udf(df3.user_agent))
df3 = df3.withColumn('version_parser_num', parse_user_agent_udf2(df3.user_agent))
# # Agregar columna 'es_celu' que contiene un booleano indicando si el dispositivo es un móvil
df3 = df3.withColumn('dev_type', categorize_device_udf(df3.user_agent))

# Mostrar DataFrame resultante
df3.show()

# Guardar en una tabla de hadoop en formato ORC
df3.write.format("orc").mode("overwrite").saveAsTable("sandbox_datascientist.jfp_equipos_actualizables_user_agent_inter")

